import * as React from 'react';
import type { Conversation } from '../../types/conversation';

interface AIFeaturesProps {
  conversation: Conversation;
}

export const AIFeatures: React.FC<AIFeaturesProps> = ({ conversation }) => {
  return (
    <div className="ai-features">
      {conversation.aiSuggestions && (
        <div className="suggested-replies">
          <h4>Suggested Replies</h4>
          <div className="suggestions-list">
            {conversation.aiSuggestions.map((suggestion, index) => (
              <button key={index} className="suggestion-button">
                {suggestion}
              </button>
            ))}
          </div>
        </div>
      )}
      {conversation.summary && (
        <div className="conversation-summary">
          <h4>Summary</h4>
          <p>{conversation.summary}</p>
        </div>
      )}
      <div className="ai-actions">
        <button className="ai-action-button">
          <span role="img" aria-label="summarize">üìù</span>
          Generate Summary
        </button>
        <button className="ai-action-button">
          <span role="img" aria-label="report">üìä</span>
          Generate Report
        </button>
      </div>
    </div>
  );
};
